import React from 'react'
import PropTypes from 'prop-types'


const PhotoCardsView = ({ owner, id, onClick }) => {
    return <div class="column is-one-quarter" onClick={onClick}>
        <figure className="image container" style={{ width: '100%' }}>
            <img style={{
                borderStyle: 'groove'
            }} src={`http://localhost:5000/photos/${owner}/${id}`} alt="" />
            <input className="check" type="checkbox" style={{ position: 'absolute', right: 0, bottom: 0 }} />
        </figure>
    </div>
}


PhotoCardsView.propTypes = {
    owner: PropTypes.string,
    id: PropTypes.string.isRequired,
    onClick: PropTypes.func.isRequired
}



export default PhotoCardsView
